import React from "react";
import Card from "../Card/Card";
import "./LunarCrush.scss";

function LunarCrush() {
  return (
    <div className="container">
      {props.lunarApi.map((api) => {
        <Card key={api.id} coinName={api.n} coinPrice={api.p} />;
      })}
    </div>
  );
}

export default LunarCrush;
